import React, { useState } from 'react';
import { Box, Typography, Modal, IconButton } from '@mui/material';
import MailOutlineIcon from '@mui/icons-material/MailOutline';

const About = () => {
  const [open, setOpen] = useState(false);

  const handleOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);

  return (
    <Box
      sx={{
        minHeight: '100vh',
        color: '#f5f5dc',
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        px: { xs: 2, sm: 4, md: 6, lg: 8, xl: 12 },
        py: { xs: 4, sm: 6, md: 8, lg: 10, xl: 12 },
        pt: { xs: 10, sm: 10, md: 10, lg: 10, xl: 16 },
        backgroundColor: '#001f4d', // Lacivert arka plan
      }}
    >
      {/* Resim */}
      <Box
        component="img"
        src="img1.webp"
        alt="Profil Resmi"
        onClick={handleOpen}
        sx={{
          width: { xs: 220, sm: 180, md: 160, lg: 140, xl: 200 },
          height: { xs: 220, sm: 180, md: 160, lg: 140, xl: 200 },
          borderRadius: '80%',
          boxShadow: `
            0 0 10px 2px rgb(250, 249, 252),
            0 0 20px 6px rgb(255, 255, 255),
            0 0 30px 10px rgb(23, 6, 83)
          `,
          mb: { xs: 2, sm: 3, md: 4, lg: 5, xl: 6 },
          objectFit: 'cover',
          cursor: 'pointer',
          transition: 'transform 0.3s ease',
          '&:hover': {
            transform: 'scale(1.1)',
            boxShadow: `
              0 0 15px 4px #00bfff,
              0 0 30px 10px #00bfff,
              0 0 40px 15px #1e90ff
            `,
          },
        }}
      />

      {/* Modal - Resmin bÃ¼yÃ¼yerek aÃ§Ä±lmasÄ± */}
      <Modal open={open} onClose={handleClose} closeAfterTransition>
        <Box
          onClick={handleClose}
          sx={{
            position: 'fixed',
            top: 0,
            left: 0,
            width: '100vw',
            height: '100vh',
            bgcolor: 'rgba(0,0,0,0.8)',
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center',
            cursor: 'zoom-out',
            zIndex: 1300,
          }}
        >
          <Box
            component="img"
            src="img1.webp"
            alt="Profil Resmi BÃ¼yÃ¼k"
            sx={{
              maxWidth: '90vw',
              maxHeight: '90vh',
              borderRadius: '80%',
              boxShadow: `
                0 0 20px 5px #00bfff,
                0 0 40px 15px #1e90ff
              `,
              transition: 'transform 0.3s ease',
              transform: 'scale(1.2)',
            }}
          />
        </Box>
      </Modal>

      {/* Ä°sim */}
      <Typography
        variant="h4"
        sx={{
          fontWeight: 'bold',
          color: '#FFF',
          mb: { xs: 1, sm: 1.5, md: 2, lg: 2.5, xl: 3 },
          textAlign: 'center',
          textShadow: '0 0 40px rgb(0, 0, 0)',
        }}
      >
        Yakup ÅimÅek
      </Typography>

      {/* Kutular kapsayÄ±cÄ± */}
      <Box
        sx={{
          width: { xs: '70%', sm: '40%', md: '30%', lg: '30%', xl: '20%' },
          display: 'flex',
          flexDirection: 'column',
          gap: { xs: 1.5, sm: 2, md: 3 },
          alignItems: 'center',
        }}
      >
        {/* EÄitim TeknoloÄu kutusu */}
        <Box
          sx={{
            bgcolor: '#000B58',
            color: '#A9B5DF',
            px: { xs: 2, sm: 3, md: 4 },
            py: { xs: 2, sm: 3, md: 4 },
            borderRadius: 10,
            fontWeight: 'bold',
            fontSize: { xs: '1rem', sm: '1.1rem', md: '1.2rem' },
            textAlign: 'center',
            lineHeight: 1.5,
            width: '100%',
            transition: 'background-color 0.3s ease, box-shadow 0.3s ease',
            cursor: 'pointer',
            '&:hover': {
              bgcolor: '#002080',
              boxShadow: '0 0 15px 3px #a3c9f1',
            },
          }}
        >
          EÄitim TeknoloÄu
          <br />
          <Typography
            component="span"
            sx={{
              display: 'block',
              fontWeight: '500',
              fontSize: { xs: '0.9rem', sm: '1rem', md: '1.1rem' },
              mt: 2,
              color: '#A9B5DF',
              lineHeight: 1.4,
            }}
          >
            Ä°nteraktif iÃ§erik geliÅtirme konusunda tutkulu
          </Typography>
        </Box>

        {/* Ä°letiÅim Kutusu */}
        <Box
          onClick={() =>
            window.open('mailto:yakupsimseke@gmail.com', '_blank')
          }
          sx={{
            mt: 3,
            bgcolor: 'linear-gradient(135deg, #a3c9f1 0%, #d0e6ff 100%)',
            background: 'linear-gradient(135deg, #a3c9f1 0%, #d0e6ff 100%)',
            borderRadius: 5,
            px: 3,
            py: 1.5,
            display: 'flex',
            alignItems: 'center',
            gap: 1,
            cursor: 'pointer',
            color: '#001f4d',
            fontWeight: '600',
            fontSize: { xs: '1rem', sm: '1.1rem' },
            boxShadow: '0 0 10px 2px rgba(163,201,241,0.7)',
            userSelect: 'none',
            transition: 'box-shadow 0.3s ease',
            '&:hover': {
              boxShadow: '0 0 15px 4px #3a8dde',
            },
          }}
          role="button"
          aria-label="Ä°letiÅime GeÃ§in"
        >
          <MailOutlineIcon />
          Ä°letiÅime GeÃ§in
        </Box>
      </Box>
    </Box>
  );
};

export default About;
